import React from 'react';

import Todo from './Todo';

const TodoList = ({ list, setList }) => {
    return (
        <div>
            <ul>
                {list.map((task) => {
                    <Todo text={task.text}/>
                })}
            </ul>
        </div>
    )
}

export default TodoList;
